function Home() {
   let v = 10;

   // any javascript
   let courses = [{code: "Comp 141 A"}];
   async function getCourses() {
    await fetch("http://localhost:8080/courses")
     .then(response => { courses = response.json() })
   }
   getCourses()
   console.log(courses)
   return (
    <div className="Home">
    <h1 class = "pad">Scheduler Application </h1>
    <Dropdown/>
    <Search />
    <SearchBar />
      <ul>
        <li>{ courses[0].code }</li>
      </ul>
    </div>
   )
}

export default Home;
